import { categories } from '../utils/constants';

const Sidebar = () => {
    <Stack
        direction = "row" 
        sx = {{ overflow: "auto", height: {sx: "auto", md: "95%" }, flexDirection: { md: 'column', }, 
        }}
    >
        {categories.map((category) => (
            <buttonc className>
                <span>{category.icon}</span>
                <span>{category.name}</span>
            </buttonc>
        ))}
    </Stack>
}

export default Sidebar;
